import React from "react";
import ReactDOM from "react-dom/client";
import "./App.css";
function List(props) {
  return <li>I am a {props.fruit}</li>;
}

function App() {
  const Fruits = ["Apple", "Banana", "Guava"];
  return (
    <ul>
      {Fruits.map((fruit) => {
        return <List />;
      })}
    </ul>
  );
}

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(<App />);
